import React from "react";
import NewsSection from "./components/NewsSection";
import { AppProvider } from "./context/AppContext";
import { Navbar } from "react-bootstrap";

function App() {
  return (
    <AppProvider>
      <div className="App">
        <Navbar />
        <NewsSection />
      </div>
    </AppProvider>
  );
}

export default App;
